// The purpose of this test is to check that, altough we
// need to capture 'this' as firstprivate in the task outline
// we do not need it when building compute_dep function/call

struct S {
  S() {}
  void foo(int a);
};

#pragma oss task in(*a)
void bar(int *a, S *s) {};

void S::foo(int a) {
  bar(&a, this);
}

int main() {
  S s;
}

